import { IonContent, IonHeader, IonCard, IonCardHeader, IonCardSubtitle, IonCardTitle, IonCardContent, IonPage,IonList, IonTitle, IonToolbar, IonButtons, IonButton, IonIcon, IonVirtualScroll } from '@ionic/react';
import Annoce from './annocements';
import Devotions from './devotions';
import { useState } from 'react';
// import { IonHeader, IonToolbar, IonIcon,IonTitle } from "@ionic/react";
import { Link } from "react-router-dom";
import { arrowBackSharp } from "ionicons/icons";
import './subscription.css'


const SubscriptionTabs: React.FC = () => {

  const loop = [1,2,3,4, 5, 6];
  const [page, setpage] = useState(1)

  return (
    <IonPage>
       <IonHeader>
        <IonToolbar>
              <Link to='/devotions' id='backBtn'> 
              <IonIcon icon={arrowBackSharp}>back</IonIcon>
              Back
              </Link >
              <IonTitle id='mainHead'>Mpumelelo fellowship</IonTitle>
          </IonToolbar>
        </IonHeader>
        <div id="tabs" >
          <IonButton fill='clear' onClick={() =>{setpage(1)}} className='tabBtn'>Annoucements</IonButton>
          <IonButton fill='clear' onClick={() =>{setpage(2)}} className='tabBtn'>Devotions</IonButton>
          <IonButton fill='clear' onClick={() =>{setpage(3)}} className='tabBtn'>Discussions</IonButton>
        </div>
        <IonContent className='tabInfo mb-5' >
          {page == 1 && <Annoce />}
          {page == 2 && <Devotions />}
        </IonContent>

    </IonPage>
  );
};

export default SubscriptionTabs;
